export function fetchStocks() {
    return fetch("https://api.odcloud.kr/api/GetStockSecuritiesInfoService/v1/getStockPriceInfo?resultType=json&serviceKey=GU%2FPw6QXvxX8rdXGsY9vDQWG3v8mr8imsKIAHd11KmEe0GOfu5NFoK4bv96cfhkwLKdy85VXG1mtXprIuY2HAw%3D%3D&numOfRows=20&pageNo=1").then((response) => 
        response.json().then(
            (res) => 
            res.response.body.items.item
        )
    )
}
